('2429','18','7935','Villa Enrique',Null,'Einfamilienhaus in Portals Nous mit Teilmeerblick','34082','Portals Nous ist eine der beliebtesten Wohnlagen im Südwesten Mallorcas. Zum berühmten Jachthafen Porto Portals, mit seinem vielseitigen gastronomischen Angeboten, sind es nur wenige Gehminuten und nach Palma de Mallorca nur 7 Fahrminuten. Portals Nous bietet auch verschiedene internationale Schulen. Dieses Haus steht auf einem ca 630m² grossen Grundstück und bietet auf 370m³ konstruierte Fläche ein Wohn-Esszimmer, 4 Schlafzimmer und 3 Badezimmer. Der Pool kann im Winter überdacht - und als Hallenbad genutzt werden. Mindestens  2 Autos finden Platz in der Garage. Vom 1. OG hat man einen sehr schönen Teilmeerblick. Zur Ausstattung gehören u.a. eine Gas Zentralheizung, Kamin im Hauptschlafzimmer, Klimanlage w/k u.v.m. Das Haus wurde 2015 renoviert und befindet sich in einem guten Zustand','34083','995000','106','2016-02-26 11:42:44','106','2016-02-26 11:44:28',Null,'2569','108','1205',1,'1','0',Null,Null,Null,'34084',Null,'0','0','0',Null,'2016-02-26 11:48:58',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'34085',Null,'34086',Null,'34087',Null,'34088','607295395','34089','0',0,'0');
